         __leave;
      }

      // Allocate space in the remote process for the string containing the DLL path
      remoteString = VirtualAllocEx(hProcess, NULL, strlen(dllName) + 1, MEM_COMMIT, PAGE_READWRITE);
      if (remoteString == NULL)
      {
         _tprintf(_T("[-] Error: Could not allocate memory in process for DLL path\n"));
         __leave;
      }

      // Write the string name of the DLL into the remote process's allocated space
      if (WriteProcessMemory(hProcess, remoteString, (LPVOID)dllName, strlen(dllName) + 1, NULL) == 0)
      {
         _tprintf(_T("[-] Error: Could not write DLL path into process memory\n"));
         __leave;
      }

      // Get the address of the LoadLibrary function in Kernel32.dll
      hKernel32 = GetModuleHandle(_T("Kernel32"));
      if (hKernel32 == NULL)
      {
         _tprintf(_T("[-] Error: Could not get Kernel32 handle\n"));
         __leave;
      }
      loadLibraryAddr = GetProcAddress(hKernel32, "LoadLibraryA");
      if (loadLibraryAddr == NULL)
      {
         _tprintf(_T("[-] Error: Could not get LoadLibraryA address\n"));
         __leave;
      }

      // Create a remote thread in the process that calls LoadLibraryA with the location of the DLL as a parameter
      hThread = CreateRemoteThread(hProcess, NULL, 0, (LPTHREAD_START_ROUTINE)loadLibraryAddr, remoteString, 0, &threadId);
      if (hThread == NULL)
      {
         _tprintf(_T("[-] Error: Could not create remote thread\n"));
         __leave;
      }

      // Wait for the remote thread to finish
      WaitForSingleObject(hThread, INFINITE);

      bSuccess = TRUE;
   }
   __finally
   {
      // Cleanup
      if (hThread != NULL)
      {
         CloseHandle(hThread);
      }
      if (hProcess != NULL)
      {
         CloseHandle(hProcess);
      }
      if (remoteString != NULL)
      {
         VirtualFreeEx(hProcess, remoteString, strlen(dllName) + 1, MEM_RELEASE);
      }
   }

   return bSuccess;
}

